pragma solidity ^0.5.16;

contract Migrations {
    address public owner;
    uint public last_completed_migration;

    modifier restricted() {
        if (msg.sender == owner) _;
    }

    constructor() public { // Constructor defined with the constructor keyword
        owner = msg.sender;
    }

    function setCompleted(uint completed) public restricted { // Added public visibility specifier
        last_completed_migration = completed;
    }

    function upgrade(address new_address) public restricted { // Added public visibility specifier
        Migrations upgraded = Migrations(new_address);
        upgraded.setCompleted(last_completed_migration);
    }
}
